register.text:
do
$$
    declare
        v_ts              timestamp;
        v_repeat constant int := 10;
        rec               record;
        run               int[];
        stmt              int[];
        elapsed           decimal[];
        max_elapsed       decimal;
        i                 int := 1;
    begin
        for r in 1..5
            loop
                set jit = on;
                v_ts := clock_timestamp();
                for i in 1..v_repeat
                    loop
                        for rec in (
                            select *
                            from vb_mat(17827539)
                        )
                            loop
                                null;
                            end loop;
                    end loop;
                run[i] := r;
                stmt[i] := 1;
                elapsed[i] :=
                        (extract(epoch from cast(clock_timestamp() as timestamp))
                            - extract(epoch from v_ts));
                i := i + 1;

                set jit = on;
                v_ts := clock_timestamp();
                for i in 1..v_repeat
                    loop
                        for rec in (
                            select *
                            from vb_non_mat(17827539)
                        )
                            loop
                                null;
                            end loop;
                    end loop;
                run[i] := r;
                stmt[i] := 2;
                elapsed[i] :=
                        (extract(epoch from cast(clock_timestamp() as timestamp))
                            - extract(epoch from v_ts));
                i := i + 1;

                set jit = off;
                v_ts := clock_timestamp();
                for i in 1..v_repeat
                    loop
                        for rec in (
                            select *
                            from vb_mat(17827539)
                        )
                            loop
                                null;
                            end loop;
                    end loop;
                run[i] := r;
                stmt[i] := 3;
                elapsed[i] :=
                        (extract(epoch from cast(clock_timestamp() as timestamp))
                            - extract(epoch from v_ts));
                i := i + 1;

                set jit = off;
                v_ts := clock_timestamp();
                for i in 1..v_repeat
                    loop
                        for rec in (
                            select *
                            from vb_non_mat(17827539)
                        )
                            loop
                                null;
                            end loop;
                    end loop;

                run[i] := r;
                stmt[i] := 4;
                elapsed[i] :=
                        (extract(epoch from cast(clock_timestamp() as timestamp))
                            - extract(epoch from v_ts));
                i := i + 1;
            end loop;

        select max(t.elapsed)
        into max_elapsed
        from unnest(elapsed) as t(elapsed);

        for i in 1..array_length(run, 1)
            loop
                raise info 'run %, statement %: %', run[i], stmt[i],
                    cast(elapsed[i] / max_elapsed as decimal(10, 5));
            end loop;
    end
$$;
